import React from "react";

export default function Card(props) {
  const product = props.restaurant;
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "space-around",
          minWidth: "1000px",
          alignItems: "center",
          border: "1px solid #e3e3e3",
          boxShadow: "10px 10px 50px 0px rgba(224,224,224,1)",
        }}
      >
        <div style={{ width: "200px" }}>
          <h3>{product.name}</h3>

          <div>
            <h4>{product.desc}</h4>
          </div>
        </div>
        <div>
          <button>Add</button>
        </div>
      </div>
    </div>
  );
}
